    [],nt"num_tags": 7,nt"name": "kodiak-national-wildlife-refuge-annual-narrative-report-calendar-year-1982",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Kodiak
    NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses the master plan and research and investigations.
    Refuge administration is outlined; information about personnel, funding, and safety
    is given. Habitat management is also covered; subjects include wilderness areas.
    The wildlife section of the report discusses waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, marine mammals, fisheries resources, and marking
    and bird banding. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, trapping, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    major maintenance, equipment replacement, and communication systems. Items of interest
    are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
